import React from 'react';
import {HomePage} from './components/homepage/homepage.component';

import {Switch, Route} from 'react-router-dom';
import './App.css';


const HatsPage = () => {
  return(
    <div>
      <h1>HATS PAGE</h1>
    </div>
  )
}



function App() {
  return (
    <div>
      <switch></switch>
      <Route exact path='/' component = {HomePage} />
      <Route path='/hats' component = {HatsPage} />
    </div>
  );
}

export default App;
